Grateful for the time I got to spend with this amazing Argentinian border collie, Pablo, who we lost yesterday and would have been 16 today. Thinking of Tomas and everyone this dog has touched. I met Tomas while I was touring my first book in Vermont, he showed real human kindness and hospitality to myself and Zach, who I was travelling with at the time. We bonded over our love for our dogs, and shared his incredible story. Really cherish this video that we made together and needed it to live here incase you missed it and to honour a very good dog.

